import React, { useState } from 'react';

interface CompanyCamIntegrationProps {
  projectId: string;
}

const CompanyCamIntegration: React.FC<CompanyCamIntegrationProps> = ({ projectId }) => {
  const [companyCamProjectId, setCompanyCamProjectId] = useState('');
  const [syncing, setSyncing] = useState(false);
  const [lastSync, setLastSync] = useState<Date | null>(null);
  const [syncedPhotos, setSyncedPhotos] = useState(0);

  const handleSync = async () => {
    if (!companyCamProjectId.trim()) {
      alert('Please enter a CompanyCam Project ID');
      return;
    }

    setSyncing(true);

    try {
      const response = await fetch(`/api/projects/${projectId}/sync-companycam`, {
        method: 'POST',
        headers: {
          'Content-Type': 'application/json'
        },
        body: JSON.stringify({
          companyCamProjectId: companyCamProjectId.trim()
        })
      });

      if (response.ok) {
        const result = await response.json();
        setLastSync(new Date());
        setSyncedPhotos(result.synced_photos || 0);
        alert(`Successfully synced ${result.synced_photos} photos from CompanyCam!`);

        // Refresh the page to show new files
        window.location.reload();
      } else {
        const error = await response.json();
        alert(`Sync failed: ${error.error}`);
      }
    } catch (error) {
      console.error('Sync error:', error);
      alert('Failed to connect to CompanyCam. Please try again.');
    } finally {
      setSyncing(false);
    }
  };

  return (
    <div className="mt-6 bg-white rounded-lg shadow p-6">
      <h2 className="font-bold mb-4 flex items-center">
        <span className="bg-blue-100 text-blue-800 px-2 py-1 rounded text-sm mr-3">
          CompanyCam Integration
        </span>
        Field Photo Sync
      </h2>

      <div className="space-y-4">
        <div className="bg-blue-50 border border-blue-200 rounded p-4">
          <h3 className="font-semibold text-blue-900 mb-2">Inspector Workflow:</h3>
          <ol className="text-sm text-blue-800 space-y-1">
            <li>1. Inspector receives project assignment</li>
            <li>2. Inspector visits property with CompanyCam mobile app</li>
            <li>3. Photos are taken and automatically GPS-tagged</li>
            <li>4. CompanyCam organizes photos by project ID</li>
            <li>5. Estimator syncs photos using the project ID below</li>
          </ol>
        </div>

        <div className="grid grid-cols-1 md:grid-cols-2 gap-4">
          <div>
            <label className="block text-sm font-medium text-gray-700 mb-2">
              CompanyCam Project ID
            </label>
            <input
              type="text"
              value={companyCamProjectId}
              onChange={(e) => setCompanyCamProjectId(e.target.value)}
              placeholder="Enter CompanyCam project ID"
              className="w-full px-3 py-2 border border-gray-300 rounded focus:outline-none focus:ring-2 focus:ring-blue-500"
              disabled={syncing}
            />
            <p className="text-xs text-gray-500 mt-1">
              Get this ID from the CompanyCam project created by your inspector
            </p>
          </div>

          <div className="flex flex-col justify-end">
            <button
              onClick={handleSync}
              disabled={syncing || !companyCamProjectId.trim()}
              className={`px-6 py-2 rounded font-medium ${
                syncing || !companyCamProjectId.trim()
                  ? 'bg-gray-300 text-gray-500 cursor-not-allowed'
                  : 'bg-blue-600 text-white hover:bg-blue-700'
              }`}
            >
              {syncing ? (
                <span className="flex items-center">
                  <svg className="animate-spin -ml-1 mr-3 h-5 w-5 text-white" xmlns="http://www.w3.org/2000/svg" fill="none" viewBox="0 0 24 24">
                    <circle className="opacity-25" cx="12" cy="12" r="10" stroke="currentColor" strokeWidth="4"></circle>
                    <path className="opacity-75" fill="currentColor" d="M4 12a8 8 0 018-8V0C5.373 0 0 5.373 0 12h4zm2 5.291A7.962 7.962 0 014 12H0c0 3.042 1.135 5.824 3 7.938l3-2.647z"></path>
                  </svg>
                  Syncing Photos...
                </span>
              ) : (
                'Sync CompanyCam Photos'
              )}
            </button>
          </div>
        </div>

        {lastSync && (
          <div className="bg-green-50 border border-green-200 rounded p-3">
            <p className="text-sm text-green-800">
              <strong>Last Sync:</strong> {lastSync.toLocaleString()}
              {syncedPhotos > 0 && (
                <span className="ml-2">({syncedPhotos} photos imported)</span>
              )}
            </p>
          </div>
        )}

        <div className="bg-gray-50 border border-gray-200 rounded p-3">
          <h4 className="font-medium text-gray-900 mb-2">How CompanyCam Integration Works:</h4>
          <ul className="text-sm text-gray-600 space-y-1">
            <li>• <strong>Field Documentation:</strong> Inspector uses CompanyCam mobile app on-site</li>
            <li>• <strong>GPS Tagging:</strong> All photos automatically include location data</li>
            <li>• <strong>Time Stamping:</strong> Precise documentation of when photos were taken</li>
            <li>• <strong>Project Organization:</strong> Photos organized by CompanyCam project ID</li>
            <li>• <strong>Quality Control:</strong> Professional photo management for accurate estimates</li>
          </ul>
        </div>
      </div>
    </div>
  );
};

export default CompanyCamIntegration;
